INSERT INTO `post` VALUES ('1', 'Insomnia', 'insomnia', 'Сет с которого все и началось, впервые был записан в 2004 году, с тех пор собственно ничего не изменилось, кроме качества звука - сет был переигран в 2007 только ради этой цели...', 'Сет с которого все и началось, впервые был записан в 2004 году, с тех пор собственно ничего не изменилось, кроме качества звука - сет был переигран в 2007 только ради этой цели...', 'Сет с которого все и началось, впервые был записан в 2004 году, с тех пор собственно ничего не изменилось, кроме качества звука - сет был переигран в 2007 только ради этой цели...', '1', 'MNT001', 'Noise, ambient', 'LAME 192kbps 44100Hz', '79:31', '1. Http - Звезды небесные\r\n2. I/dex - Zeel\r\n3. Pole 3 - Silbefisch\r\n4. Deep-z - Returning (Dedicated to Fula)\r\n5. I/dex - Ksren\r\n6. Plastikman - Disconnect    \r\n7. Akvalangist - Adpcm\r\n8. Fax - 20w\r\n9. David Alvarado - Aire  \r\n10. Fax - Aslip\r\n11. Deluge - Departure\r\n12. Pole 3 - Uberfahrt\r\n13. Taylor Deupree - Snow-Sand', '2013-02-27 16:04:36', '31', '2013-03-22 13:27:15');
INSERT INTO `post` VALUES ('2', 'Для IT HRs и разработчиков', 'for-it', 'Кратко о себе, основные сведения, профессиональные знания и навыки.', '<p>Кратко о себе:</p><p>Высшее техническое образование по специальности инженер-программист со специализацией информационные и интернет технологии.</p><p>Коммуникабельность, умение работать в команде, технический английский, грамотная речь, эмоциональная выдержка, большой опыт общения с клиентами (от пенсионеров до высоких должностных лиц), крепкое здоровье, без вредных превычек.</p><p>Без проблем работаю как на windows платформе, так и на linux/debian платформах. Высокие знания пакета Adobe Photoshop.</p><p>Основные сведения:</p><ul><li>Более чем 6-летний практический (3-летний коммерческий) опыт разработки web-приложений от стадии постановки задачи до запуска работающего проекта.</li><li>Высоконагруженные приложения со сложной и архитектурой и пропускной способностью более чем 5000rps. Горизонтальное и вертикальное масштабирование.</li><li>Знание, понимание и практическое использование ООП. Шаблоны проектирования.</li><li>Грамотное оформление кода (иерархия, описание, комментарии), умение читать и понимать чужой код, в т.ч. и \"плохой\".</li><li>Оптимизация существующего кода: PHP, MySQL (Join / Union / Proc), кеширование (Memcached, FileCache), поиск по большим БД (Sphinx / Solr), HTML / CSS (replace table layout on the block). Возможно составление технической документации по проекту.</li><li>Администрирование и запуск серверов: XAMPP (WinServer, WinXP/Seven), LAMP (Red Hat, Ubuntu) on Apache / Nginx + PHP (Mod, FCGI, CLI) + Memcached + MySQL / MongoDB + IspManager / Munin; высокий уровень использования Ubuntu shell / bash, опыт работы с AWS.</li><li>Отладка и профилирование кода - xDebug; системы контроля версий - SVN / GIT, ветвление, слияние, откаты и т.п.</li></ul><p> Профессиональные знания и навыки:</p><ul><li>Языки программирования: PHP 5+ лет, JS (Native / jQuery) 7+ лет , MySQL 3+ лет, NoSQL / MongoDB 1+ лет, Python / Django 1+ лет, Ruby / Rails 6+ месяцев, HTML / DHTML / XHTML / HTML5 / CSS 7+ лет.</li><li>Технологии: SOAP, OAuth, RESTful, FB Graph API, XML / XSLT / JSON / AJAX / Protobuf, Google API / Yandex API / 5+ RTB APIs.</li><li>CMS, FW и ORM: Zend, Doctrine, Magento, Joomla, Wordpress, Drupal, jQuery, Cargo, Elgg, Tomato, ZenCart, OpenCart, Mantis, LiveStreet. </li><li>Participation in projects: Blismobile.com, Clubautomation.com, OnlineAHA.org, AHALife.com, LYF.com, DealOn.com, 2buckfreight.com, 3Key.com, CrowdCloud.com, Vinatic.nl, VitaminGangster.com, NOICentral.com, Kronenbourg, PalUp, AWReminders, SaikoTeam.com, GISA.by, Srochnov.ru, Agrotour.by, NPK.of.by, NiiAR.com, Lib.PSU.by, Anastasia.travel, Kurtochka.by, Gihon.by, Damco.by и другие.</li></ul>', 'Кратко о себе, основные сведения, профессиональные знания и навыки.', '0', '', '', '', '', '', '2013-01-01 15:32:50', '10', '2013-03-20 16:57:50');
INSERT INTO `post` VALUES ('3', 'Synthetic', 'synthetic', 'На мой взгляд, самая сложная, но и самая интересная моя амбиент работа. Интеллектуальный и качественный саунд в дополнении к немецким и чешским военным разработкам )))', 'На мой взгляд, самая сложная, но и самая интересная моя амбиент работа. Интеллектуальный и качественный саунд в дополнении к немецким и чешским военным разработкам )))', 'На мой взгляд, самая сложная, но и самая интересная моя амбиент работа. Интеллектуальный и качественный саунд в дополнении к немецким и чешским военным разработкам )))', '1', 'MNT007', 'Ambient, Chillout', 'LAME 192kbps 44100Hz', '59:40', '1. Falter - Nachtflug\r\n2. H.u.v.a - Distances\r\n3. H.u.v.a. - Acces to the long fields\r\n4. Biosphere (Hia) - Gas street basin  \r\n5. Fax - Deja vu\r\n6. Telefon Tel Aviv - TTV\r\n7. Lator - B-4 talk (Promo version)\r\n8. Shuttle 358 - Floops\r\n9. Solarise speek\r\n10. Vladislav Delay - He lived deeply  \r\n11. Monolake - Indigo    ', '2013-02-27 17:27:11', '28', '2013-03-22 17:05:45');
INSERT INTO `post` VALUES ('4', 'Plastic toy', 'plastic-toy', 'Третий микс из серии \"light synthetic compilation\". Смесь амбиента, нойза и даб техно!!! Многие из треков связаны \"по-три\", тем самым усложняя и украшая \"шумовую\" картину. Сет для любителей ненапряжных битов и шумов, все медлено и запутанно.', 'Третий микс из серии \"light synthetic compilation\". Смесь амбиента, нойза и даб техно!!! Многие из треков связаны \"по-три\", тем самым усложняя и украшая \"шумовую\" картину. Сет для любителей ненапряжных битов и шумов, все медлено и запутанно.', 'Третий микс из серии \"light synthetic compilation\". Смесь амбиента, нойза и даб техно!!! Многие из треков связаны \"по-три\", тем самым усложняя и украшая \"шумовую\" картину. Сет для любителей ненапряжных битов и шумов, все медлено и запутанно.', '1', 'MNT017', 'Ambient, Chillout', 'LAME 320kbps 44100Hz', '49:01', '1. Biosphere - Kobresia\r\n2. Lowtec - A2 untitled\r\n3. I/dex - Drafts\r\n4. Pole-3 - Rondell zwei\r\n5. Minilogue - Stations II\r\n6. Ike - Cluster funk\r\n7. Intrusion - Tswana dub (Brendon Moeller vs Beat Pharmacy dub)\r\n8. Harmash - Hibernatoria08\r\n9. Apparat - Wooden (Anders Ilar remix)\r\n10. Minilogue - City lights\r\n11. Dolby - He0r\r\n12. Harmash - Hibernatoria05\r\n13. Minilogue - Cow, crickets and clay', '2013-02-27 17:44:22', '11', '2013-03-22 13:27:25');
INSERT INTO `post` VALUES ('5', 'Solaris', 'solaris', 'Четвертый микс из серии \"light synthetic compilation\". Почти год я собирал и отфильтровывал материал с \"исключительным\" звучанием. По традиции сет построен по любимой схеме \"два+три\" (одновременно звучит более двух треков), тем самым усложняя и украшая \"шумовую\" картину.', 'Четвертый микс из серии \"light synthetic compilation\". Почти год я собирал и отфильтровывал материал с \"исключительным\" звучанием. По традиции сет построен по любимой схеме \"два+три\" (одновременно звучит более двух треков), тем самым усложняя и украшая \"шумовую\" картину.\r\nСет так назван не случайно, интро  - саундтрек к голливудской версии фильма \"Солярис\". Я очень долго его искал, но все-таки нашел. \r\nСлушайте, медитируйте, наслаждайтесь... ', 'Четвертый микс из серии \"light synthetic compilation\". Почти год я собирал и отфильтровывал материал с \"исключительным\" звучанием. ', '1', 'MNT021', 'Ambient, Chillout', 'LAME 320kbps 44100Hz', '52:44', '1. Cliff Martinez - We don\'t have to think like that anymore\r\n2. Cliff Martinez - First sleep\r\n3. Alva Noto - Xerrox monophaser 1\r\n4. Indo - Pneuma\r\n5. Avec.Berre - Stepdrop\r\n6. Ilpo Vaisanen - Autioitu 1\r\n7. Kassian Troyer - Plant shift\r\n8. Valliam – In samsara\r\n9. Clint Mansell - Stay with me\r\n10. Astrum - Saturn\r\n11. Pinch meets Pavel Ambiont - Poison/Remedy\r\n12. Alva Noto - Xerrox phaser acat 1', '2013-02-28 12:31:11', '11', '2013-03-14 17:14:59');
INSERT INTO `post` VALUES ('6', 'Stockholm syndrome', 'stockholm-syndrome', 'Очень не стандартный для меня микс, как по компиляции, так и по технике. Специально не затачивался по мое ДР, но так уж получилось, что микс был закончен именно в этот день, знаменательно.', 'Очень не стандартный для меня микс, как по компиляции, так и по технике. Специально не затачивался по мое ДР, но так уж получилось, что микс был закончен именно в этот день, знаменательно.\r\nВоодушевила меня на создание такого микса команда GusGus, так что любителям их творчества посвящается...', 'Очень не стандартный для меня микс, как по компиляции, так и по технике', '1', 'MNT031', 'Tech House, Deep House', 'LAME 320kbps 44100Hz', '1:18:34', '0. Intro - Crimea\r\n1. Tube & Berger - Come Together (Original Mix) - Kittball\r\n2. Markus Fix - I\'ll House You (Original Mix) - Cecille\r\n3. Tiefschwarz feat. Cassy - Find me - Souvenir\r\n4. Oxia - Housewife (feat. Miss Kittin) - Infine France\r\n5. Royksopp - Tricky Tricky (Beyond Deep remix)\r\n6. Aki Bergen - Dont call me artist - Plastic City\r\n7. Sian - East of eden (Original mix) - Coocon\r\n8. Popsled and Magit Cacoon - Higher point (Original mix) - Be As One\r\n9. Oxia, Simon Mattson - Harmonie (Simon Mattson Remix) - Infine France\r\n10. Dusty Kid - Cowboys - Kling Klong\r\n11. Swayzak - Make up your mind - K7\r\n12. Terry Lee Brown Junior - Bohemian life - Plastic City\r\n13. Agoria, Carl Craig and La Scalars - Speechless (Radio Slave remix) - Infine France', '2013-02-28 13:08:43', '4', '2013-03-22 17:41:22');
INSERT INTO `post` VALUES ('8', 'Autoreply promo', 'autoreply', 'Весенний промо микс на тему дип хауза. Очень долгожданный микс для меня, после длительного драмового запоя, хотя и записался довольно спонтанно.', 'Весенний промо микс на тему дип хауза. Очень долгожданный микс для меня, после длительного драмового запоя, хотя и записался довольно спонтанно.', 'Весенний промо микс на тему дип хауза. Очень долгожданный микс для меня, после длительного драмового запоя.', '1', 'MNT027', 'Deep House', 'LAME 320kbps 44100Hz', '58:54', '0. Intro - Tokyo\r\n1. Fish Go Deep - Deep like - Ornate Music\r\n2. Brawther - Spaceman funk (Deep club mix) - Secretsundaze\r\n3. Ion Ludwig - L\'Sable - Trelik\r\n4. Dublee - Touch (Sweetbutter mix) - Mule Electronic Japan\r\n5. Oscar Barila and Maiki - Above the clouds - Acker Records\r\n6. Ben Rourke - Tahiti - Stuga Musik\r\n7. Nikola Gala - I don\'t stop - Plastic City\r\n8. The Timewriter - Superschall (M.In remix) - Plastic City\r\n9. Oscar Barila - Tampa - Parquet Recordings\r\n10. Jussi Pekka - Stream horse (Motorcitysoul remix) - Laka Germany\r\n11. Thomas Bjerring - Republique - Traum Schallplatten', '2013-02-28 13:12:25', '5', '2013-03-22 17:09:37');
INSERT INTO `post` VALUES ('9', 'Katana', 'katana', 'Этот сет является очень чистой эссенцией техничного драма. Компилился долго и упорно, в итоге получилось довольно качественно.', 'Этот сет является очень чистой эссенцией техничного драма. Компилился долго и упорно, в итоге получилось довольно качественно.', 'Этот сет является очень чистой эссенцией техничного драма.', '1', 'MNT025', 'Techstep, Neurostep', 'LAME 320kbps 44100Hz', '57:32', '0. Sunchase - Asphalt\r\n1. Amoss - Flex\r\n2. Alix Perez - Behind time\r\n3. Trinity - Harvester\r\n4. Paperclip - Blueprints\r\n5. Enei - No Fear (feat. Riya)\r\n6 Need for mirrors - Skip rope\r\n7. Enei - Cracker (Jubei remix)\r\n8. Optiv & BTK - Inception\r\n9. Ulterior Motive - Seven Segments\r\n10. Dub Phizix - Four (feat. Skeptical)\r\n11. Nickbee - Carpe diem\r\n12. Malk - My crazy baby\r\n13. Parhelia - Spaceship named Andromeda', '2013-02-28 13:15:46', '39', '2013-03-22 16:22:45');
INSERT INTO `post` VALUES ('10', 'Дом разбитых сердец, начало', 'hobh-one', 'Для всех тех, кто страдает...', 'Для всех тех, кто страдает...', 'Для всех тех, кто страдает...', '1', 'MNT003', 'Ambient, Lounge', '192kbps 44100Hz Stereo', '64:54', '1. Telepopmusik - 6p_6q_=h_4n\r\n2. Amon Tobin - Mighty micro people\r\n3. Manmademan - Breeze\r\n4. Nuclear Ramjet - Near earth project\r\n5. Telefon Tel Aviv - When it happens, it moves all by itself\r\n6. Imogen Heap - Hide & seek \r\n7. Halou - Ill carri you\r\n8. marco_manti - Music for Lilou \r\n9. Linkin Park - My December (Alter-Native mastering) \r\n10. switch (depeche mode)\r\n11. Junkie XL - We become one\r\n12. Planet Funk feat. Sally Doherty - Dusk\r\n13. 2Raumwohnung - Wir erinnern uns nicht\r\n14. Daft Punk - Something about us\r\n15. A-ha - Summer moved on', '2013-02-28 14:15:20', '6', '2013-03-22 13:26:58');
INSERT INTO `post` VALUES ('11', 'Дом разбитых сердец II, пепел', 'hobh-two', 'Вторая часть работы под общим названием \"Дом разбитых сердец\". Главная особенность данной компиляции в том, что абсолютно все треки - музыка \"наших\" исполнителей, это можно без труда заметить по треклисту. Вся музыка собиралась годами и тщательно фильтровалась. ', 'Вторая часть работы под общим названием \"Дом разбитых сердец\". Главная особенность данной компиляции в том, что абсолютно все треки - музыка \"наших\" исполнителей, это можно без труда заметить по треклисту. Вся музыка собиралась годами и тщательно фильтровалась. ', 'Вторая часть работы под общим названием \"Дом разбитых сердец\".', '1', 'MNT015', 'Indie, Lounge ', 'LAME 320kbps 44100Hz', '60:32', '1. Tokio - Когда ты плачешь \r\n2. Дельфин - Весна\r\n3. Без билета - Ромашка\r\n4. Земфира - Прости меня моя любовь\r\n5. Гришковец - Извини\r\n6. Ленинград - У меня есть все\r\n7. Грин грей - Осень\r\n8. 5\'nizza - Сюрная\r\n9. Океан ельзи - Вiдпусти\r\n10. Дельфин - Любовь\r\n11. T9 - Ода нашей любви\r\n12. Party makers - Новая любовь\r\n13. Нагано - Голос андеграунда\r\n14. Krec - Искра', '2013-02-28 14:19:56', '2', '2013-03-20 16:57:01');
INSERT INTO `post` VALUES ('12', 'Дом разбитых сердец III, такая Lite', 'hobh-three', 'Только тогда рождаются такие сеты, когда по-настоящему больно...', 'Только тогда рождаются такие сеты, когда по-настоящему больно...', 'Только тогда рождаются такие сеты, когда по-настоящему больно...', '1', 'MNT019', 'Rock, Alternative', 'LAME 320kbps 44100Hz', '58:25', '1. Radiohead - Street spirit\r\n2. Blink 182 - I miss you\r\n3. Khoiba - That reason\r\n4. Royksopp - Vision one \r\n5. Planet Funk - Ultraviolet days\r\n6. Depeche Mode - Freelove\r\n7. Red Hot Chili Peppers - Scar tissue\r\n8. Coldplay - Clocks\r\n9. Sum 41 - Pieces\r\n10. Three Days Grays - Home\r\n11. Linkin Park - In the end\r\n12. The Cardigans - Erase and rewind\r\n13. Air - How does it make you feel', '2013-02-28 14:24:25', '8', '2013-03-22 17:41:46');
INSERT INTO `post` VALUES ('13', 'Дом разбитых сердец 4, южные сны', 'hobh-four', 'Опять с разбитым сердцем, опять все болит, ноет и плачет… Не собирался компиляцию эту выпускать, по крайней мере так быстро, но так уж сошлись звезды.', 'Опять с разбитым сердцем, опять все болит, ноет и плачет… Не собирался компиляцию эту выпускать, по крайней мере так быстро, но так уж сошлись звезды, да и много чего накипело, поэтому высказался так, как смог. Многое мне очень близко в этих словах: «кое что между строк, кое что в кавычках». Спасибо парням, которые их пишут. Не относитесь серьезно к качеству, технике и другим бездушным параметрам, просто слушайте, если вам это близко.', 'Опять с разбитым сердцем, опять все болит, ноет и плачет… ', '1', 'MNT022', 'Hip-Hop', 'LAME 320kbps 44100Hz', '43:12', '1. Guf feat. Princip – Заходит луна\r\n2. Баста – Любовь без памяти\r\n3. Krec feat. Maestro A-Sid – Весна\r\n4. Каста – Встреча\r\n5. Смоки Мо – Герман и Патрик\r\n6. Дельфин – Надежда\r\n7. Guf feat. Ба – Дома\r\n8. Krec – Другие берега\r\n9. Лельфин – Любовь\r\n10. Михей и Джуманжи – Сука любовь\r\n11. Krec – Южные сны', '2013-02-28 14:28:30', '3', '2013-03-22 17:41:43');
INSERT INTO `post` VALUES ('14', 'Для клубных промоутеров', 'for-promouters', 'Родился и вырос в г.Новополоцке (Беларусь). Сейчас живу в Минске.\r\nЗакончил музыкальную школу по классу фортепиано (11 лет!!!). Из них 6 лет отбомбил в ударной группе духового оркестра.', '<p>Родился и вырос в г.Новополоцке (Беларусь). Сейчас живу в Минске.</p><p>Закончил музыкальную школу по классу фортепиано (11 лет!!!). Из них 6 лет отбомбил в ударной группе духового оркестра.</p><p>Потом университет ПГУ, программное обеспечение информационных и интернет технологий, т.е. я - Программист, чем и зарабатываю себе на жизнь.</p><p>Интерес к музыке возник где-то в году \'98. Сначала это было как у большинства моих друзей - децл))), дельфин и земфира, а потом меня понесло в другую от всех сторону - freestylers, bonfunk mc\'s, потом the prodigy, scooter, chemical brothers и т.д.</p><p>По сути люблю deep, noise, drum, minimal и еще кучу других направлений и стилей, также и играю, почти все, что нравится.</p><p>Поворотные музыкальные моменты в жизни - Richie Hawtin, потом Lator, а с утра Слава Финист. Отсюда и началась эпопея с теч хаузом и минималом. Немаловажными в формировании вкуса были поездки на КаZАнтип в \'05 и \'06 годах. </p><p>Позже был лес, Olien, Goa Gil - так я познакомился и заинтересовался психоделикой. После чего и родился двойник Janaca Express, который в последствии был \"вживую\" сыгран в клубе ХХ век. </p><p>Долгое время очень интересовал драм, а точнее techstep, neurofunk и darkstep. Два основных фактора, повлиявших на это - первых 56 релизов лэйбла \"Subtitles\" и творчество монстра даркстепа - Current Value. На данный момент это направление не потеряно, а лишь развивается по своей тонкой линии.</p><p>Последние годы стал все больше возвращаться к хаузу и его техничному направлению вместе с исконным техно и минималом. Благодаря этому, собралась уже небольшая коллекция винила, также этому способствовало появление виниловых проигрывателей.</p><p>На новый 12-й год сделал себе подарок - собрал комплект трактора, чему был несказанно рад. Сейчас и использую преимущественно его.</p><p>Люблю: Виниловые пластинки, рупорный аналоговый звук, полноформатные фотоаппараты, Sony и Adidas.</p><p>Ненавижу: Телефон и беспорядок.</p><p>Рекомендую: Стивен Содерберг, Трудности перевода.</p><p>Интересуюсь: Музыка, акустика, фотография, космос, World of Tanks.</p><p>Знаю: Несколько языков программирования, нотную грамоту и сольфеджио.</p><p>Умею: Есть два понятия - хочу и мне лень, а про то что я не умею пока, мне расскажет гугл.</p>', 'Родился и вырос в г.Новополоцке (Беларусь). Сейчас живу в Минске.\r\nЗакончил музыкальную школу по классу фортепиано (11 лет!!!).', '0', '', '', '', '', '', '2013-01-01 15:32:50', '20', '2013-03-22 13:16:57');
INSERT INTO `post` VALUES ('16', 'Правила и Копирайт', 'copyrights', 'При использовании материалов с данного сайта, обязательна ссылка на сайт, автора и первоисточник!', '<p><strong>При использовании материалов с данного сайта, обязательна ссылка на сайт, автора и первоисточник!</strong></p><p>Информация для правообладателей</p><p>Если Вы являетесь правообладателем какого-либо материала, ссылка (либо ссылки) на который размещена на этом сайте, и не хотели бы чтобы данная информация распространялась пользователями без Вашего на то согласия, то мы будем рады оказать Вам содействие, удалив соответствующие ссылки.</p><p>Для этого необходимо, чтобы вы прислали нам письмо (в электронном виде) в котором указали нам следующую информацию:<ol><li>Документальное подтверждение ваших прав на материал, защищенный авторским правом:<ul><li>Отсканированный документ с печатью, либо</li><li>Email с официального почтового домена компании правообладателя, либо</li><li>Иная контактная информация, позволяющая однозначно идентифицировать вас, как правообладателя данного материала.<li></ul></li><li>Текст который Вы желаете разместить в сопровождении удаляемой информации. В нем вы можете указать где, и на каких условиях можно получить информацию, ссылки на которую были удалены, а так же ваши контактные данные, для того чтобы пользователи могли получить от вас всю интересующую их информацию относительно данного материала.</li><li>Прямые ссылки на страницы сайта, которые содержат ссылки на данные, которые необходимо удалить. Ссылки должны иметь вид http://manti.by/xxxx/xx/xx либо подобный.</li></ol><p>После этого, в течении 48 часов, мы удалим интересующие Вас ссылки с сайта.</p><p><strong>ВНИМАНИЕ!!!</strong></p><p>Мы оставляем за собой право публикации на сайте любой информации присланной нам по почте через форму обратной связи.</p><p>Мы не осуществляем контроль за действиями пользователей, которые могут повторно размещать ссылки на информацию, являющуюся объектом вашего авторского права. Любая информация на форуме, размещается автоматически, без какого либо контроля с чьей либо стороны, что соответствует общепринятой мировой практике размещения информации в сети интернет. Однако, мы в любом случае рассмотрим все Ваши запросы, относительно ссылок на информацию, нарушающую Ваши права.</p><p>Согласно закону об Авторском и Смежном правах, ссылка на любые данные (информационное сообщение), сама по себе, не является объектом авторского права. Таким образом, не стоит присылать письма содержащие угрозы либо требования, как не имеющие под собой реальных оснований.</p>', 'При использовании материалов с данного сайта, обязательна ссылка на сайт, автора и первоисточник!', '0', '', '', '', '', '', '2013-01-01 15:32:50', '11', '2013-03-20 16:58:02');
